import React from 'react'
import exerciseImg from '../images/exercise.png'

class Card extends React.Component {
    /*background: url('../../images/circles.png') no-repeat, linear-gradient(to right, #A74CF2, #617BFB);*/
    render(){
        return(
            <div className="card mx-auto Fitness-Card"
                style={{}}
            >
                <div className="card-body">
                    <div className="row center">
                        <div className="col-6">
                            <img src={exerciseImg} alt="Exercise img" className="float-right"/>
                        </div>
                        <div className="col-6 Fitness-Card-Info">
                            <h1>Technique Guides</h1>
                            <p>Learn amazis street workout and calisthenics</p>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}
export default Card
